        "summary": "According to the Say Hey (I Love You) Songfacts, after 15 years of pioneering social humanitarianism through his blend of hip hop funk, jazz, reggae and rock, on this song Michael Franti wanted to do something different. He told Billboard: \"I've made political music my whole life. But at the end of this project, I thought we needed a fun, singalong song given the serious things happening in the world. And while I can't wipe the smile off my face about the song's success, it's just another reminder for me to just make music for the love of it.\" <a href=\"http://www.last.fm/music/Michael+Franti+&+Spearhead/_/Say+Hey+(I+Love+You)\">Read more on Last.fm</a>.",
